import React from "react";
import { Outlet, Link } from "react-router-dom";
import "./UserDashboard.css"; // Your combined CSS file
import { FaUser, FaBook, FaClipboardList, FaSignOutAlt, FaBars } from 'react-icons/fa';

const UserDashboard = () => {
  const username = localStorage.getItem("username"); // Get username from storage
  const [isCollapsed, setIsCollapsed] = useState(false);

  const toggleSidebar = () => {
    setIsCollapsed(!isCollapsed);
  };
  const handleLogout = () => {
    localStorage.removeItem("username"); // Clear username
    window.location.href = "/login"; // Redirect to login
  };

  return (
    <>
        <div className="flex h-screen">
      {/* Sidebar */}
      <div
        className={`bg-gray-800 text-white border border-gray-600 transition-all duration-300 ${
          isCollapsed ? 'w-16' : 'w-56'
        }`}
      >
        {/* Sidebar Header */}
        <div className="flex items-center justify-between p-4">
          <FaBars
            className="cursor-pointer text-xl"
            onClick={toggleSidebar}
          />
        </div>

        {/* Menu Items */}
        <div className="mt-10">
          {/* Welcome */}
          <div className="flex items-center p-4 hover:bg-gray-700 cursor-pointer">
            <FaUser size={20} />
            {!isCollapsed && <span className="ml-4">Hello, {username}</span>}
          </div>

          <div
            className="flex items-center p-4 hover:bg-gray-700 cursor-pointer"
            onClick={() => navigate('/userBookList')}
          >
            <FaBook size={20} />
            {!isCollapsed && <span className="ml-4">Home</span>}
          </div>

          <div
            className="flex items-center p-4 hover:bg-gray-700 cursor-pointer"
            onClick={() => navigate('/bookingList')}
          >
            <FaClipboardList size={20} />
            {!isCollapsed && <span className="ml-4">My Bookings</span>}
          </div>

            <div
            className="flex items-center p-4 hover:bg-gray-700 cursor-pointer"
            onClick={() => navigate('/reservationList')}
          >
            <FaClipboardList size={20} />
            {!isCollapsed && <span className="ml-4">My Reservations</span>}
          </div>


          {/* Logout */}
          <div
            className="flex items-center p-4 hover:bg-gray-700 cursor-pointer"
            onClick={handleLogout}
          >
            <FaSignOutAlt size={20} />
            {!isCollapsed && <span className="ml-4">Logout</span>}
          </div>
        </div>
      </div>

      {/* Main Content */}
      <main className="flex-grow ">
      <div className="flex-grow " >
            <div className="tabs bg-gray-800 text-white flex-grow z-50 ">
                {tabs.map((tab) => (
                <button
                    key={tab.key}
                    className={`px-16 py-3 text-sm font-medium border-b-3 ${
                    currentTab === tab.key
                        ? 'border-blue-500 text-blue-300 bg-gray-900'
                        : 'border-transparent hover:border-gray-700 hover:bg-gray-700'
                    }`}
                    onClick={() => handleTabChange(tab.key)}
                >
                    {tab.label}
                </button>
                ))}
           </div>
           <div>
               <Outlet />
           </div>

        </div>
      </main>
    </div>
  );
      {/* Menu Bar */}
      <nav className="menu-bar">
        <div className="menu-links">
          <Link to="/userBookList">Home</Link>
          <Link to="/bookingList">My Bookings</Link>
          <Link to="/reservationList">My Reservations</Link>
        </div>
        <div>
          <span className="welcome-message">Welcome, {username || "User"}</span>
          <button className="logout-button" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </nav>

      {/* Page Content */}
      <main className="container">
        <Outlet /> {/* Placeholder for nested routes */}
      </main>
    </>
  );
};

export default UserDashboard;
